export default function Header(){
  return (
    <div className="header">
      <select>
        <option>all</option>
        <option>genres</option>
        <option>title</option>
        <option>rate</option>
        <option>year</option>
      </select>
      <input className="search" />
      <input className="logo-search" />
      <img src={require("../../images/cart2.png")} alt="cart"/>
      <span className="cart">Cart</span>
      <span className="sign">Sign In</span>
    </div>
  )
}

